import React, {useState} from 'react'
import './components/login.css'

const Login = () => {
    const[firstName, setFirstName] = useState("");
    const[lastName, setLastName] = useState("");
    const[email, setEmail] = useState("");
    const[pass, setPass] = useState("");
    const[confirmPass, setConfirmPass] = useState("");
    const[phoneNumber, setPhoneNumber] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("First Name:", firstName);
        console.log("Last Name:", lastName);
        console.log("Email:", email);
        console.log("Password:", password);
        console.log("Confirm Password:", confirmPassword);
        console.log("Phone Number:", phoneNumber);
    };
  return (
    <>
      <div className='container'>
        <div className='flex_container'>
            <h1 className='h1'>Sign up</h1>
            <form onSubmit={handleSubmit}>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_first_name'>First Name</label></div>
                        <input type='text' id='user_first_name' name='user_first_name'value={firstName} onChange={(e) => setFirstName(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_last_name'>Last Name</label></div>
                        <input type='text' id='user_last_name' name='user_last_name'value={lastName} onChange={(e) => setLastName(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_email'>Email</label></div>
                        <input type='email' id='user_email' name='user_email' value={email} onChange={(e) => setEmail(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_pass'>Password</label></div>
                        <input type='password' id='user_pass' name='user_pass' value={pass} onChange={(e) => setPass(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_confirm_pass'>Confirm Password</label></div>
                        <input type='password' id='user_confirm_pass' name='user_confirm_pass' value={confirmPass} onChange={(e) => setConfirmPass(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <div className='label'><label htmlFor='user_tel'>Phone Number(Optional)</label></div>
                        <input type='tel' id='user_tel' name='user_tel' value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)}/>
                    </div>
                    <div className='grid-item'>
                        <button className='nice_button' type='submit'>Submit</button>
                    </div>
            </form>
        </div>
     </div>
    </>
  )
}

export default Login
